import React from 'react';
import Image from 'next/image'
import { Container } from '@material-ui/core';

export default function Index() {
  return (
    <React.Fragment>
      <Container maxWidth="xl">
      <Image
        src="/babaswamp.jpg"
        alt="Baba Yaga's House"
        layout="fill"
        objectFit="cover"
      />
      </Container>
    </React.Fragment>
  );
}
